import React from 'react'

function DataCliente(props) {
    console.log(props);
    let dataCliente=props.cliente.map((data, i)=>{
        return <React.Fragment key={i}>
            <span>EMAIL: {data.email}</span>
            <span>TELEFONO: {data.telefono}</span>
            <span>PROVINCIA: {data.provincia}</span>
            <span>PARTIDO: {data.partido}</span>
            <span>LOCALIDAD: {data.localidad}</span>
            <span>CALLE y NUMERO: {data.calle}, {data.numero}</span>
        </React.Fragment>
    })
    return (
        <details>
            <summary>Datos de Cliente</summary>
            {dataCliente}
        </details>
    )
}

export default DataCliente
